import '../App.css';
import React from 'react';

class WidgetCustomization extends React.Component {
    render() {
        return(
            <div style={{textAlign: 'left'}}>
                <div style={{backgroundColor: '#30363D', padding: '10px', marginBottom: '10px', borderRadius: '7px'}}>
                    <div style={{textAlign: 'left', margin: '0px 10px 10px 0px', display: 'flex'}}>
                        <p style={{float: 'left', color: 'white'}}>Font</p>
                        <input type="text" placeholder="City" style={{width: '70px'}}></input>
                    </div>
                </div>
            </div>
        )
    }
}

export default WidgetCustomization;
